import React from 'react';
// -----------import  reactDOM -------------//
import ReactDOM from 'react-dom/client';
import App from './App';
// ----------create root -----------------//
const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(
    <React.StrictMode>
        <App />
    </React.StrictMode>
);
